   },
   "outputs": [],
   "source": [
    "# Merge hourly_intensities and hourly_steps\n",
    "hourly_merged <- hourly_intensities_clean %>%\n",
    "  inner_join(hourly_steps_clean, by = c(\"Id\", \"Date\", \"Hour\"))\n",
    "\n",
    "# Aggregate hourly data to daily level\n",
    "hourly_daily_agg <- hourly_merged %>%\n",
    "  group_by(Id, Date) %>%\n",
    "  summarize(\n",
    "    DailyTotalIntensity = sum(TotalIntensity, na.rm = TRUE),\n",
    "    DailyAverageIntensity = mean(AverageIntensity, na.rm = TRUE),\n",
    "    DailyStepTotal = sum(StepTotal, na.rm = TRUE),\n",
    "    .groups = \"drop\"\n",
    "  )\n",
    "\n",
    "# Merge all daily data\n",
    "daily_complete <- daily_activity_clean %>%\n",
    "  left_join(sleep_day_clean, by = c(\"Id\", \"Date\")) %>%\n",
    "  left_join(hourly_daily_agg, by = c(\"Id\", \"Date\"))"
   ]
  },
