   "source": [
    "# Calculate user-level averages\n",
    "user_averages <- daily_complete %>%\n",
    "  group_by(Id) %>%\n",
    "  summarize(\n",
    "    # Activity metrics\n",
    "    AvgTotalSteps = mean(TotalSteps, na.rm = TRUE),\n",
    "    AvgTotalDistance = mean(TotalDistance, na.rm = TRUE),\n",
    "    AvgVeryActiveMinutes = mean(VeryActiveMinutes, na.rm = TRUE),\n",
    "    AvgFairlyActiveMinutes = mean(FairlyActiveMinutes, na.rm = TRUE),\n",
    "    AvgLightlyActiveMinutes = mean(LightlyActiveMinutes, na.rm = TRUE),\n",
    "    AvgSedentaryMinutes = mean(SedentaryMinutes, na.rm = TRUE),\n",
    "    AvgCalories = mean(Calories, na.rm = TRUE),\n",
    "    \n",
    "    # Sleep metrics\n",
    "    AvgTotalSleepRecords = mean(TotalSleepRecords, na.rm = TRUE),\n",
    "    AvgTotalMinutesAsleep = mean(TotalMinutesAsleep, na.rm = TRUE),\n",
    "    AvgTimeInBed = mean(TotalTimeInBed, na.rm = TRUE),\n",
    "    AvgSleepEfficiency = mean(SleepEfficiency, na.rm = TRUE),\n",
    "    \n",
    "    # Intensity and steps metrics\n",
    "    AvgTotalIntensity = mean(DailyTotalIntensity, na.rm = TRUE),\n",
    "    AvgAverageIntensity = mean(DailyAverageIntensity, na.rm = TRUE),\n",
    "    AvgStepTotal = mean(DailyStepTotal, na.rm = TRUE),\n",
    "    \n",
    "    # Data completeness metric\n",
    "    DataCompleteness = sum(!is.na(Date)) / 31  # Assuming a month of data\n",
    "  )"
   ]
  },
