    "\n",
    "clustering_vars <- c(\"AvgTotalSteps\", \"AvgVeryActiveMinutes\", \"AvgFairlyActiveMinutes\", \n",
    "                     \"AvgLightlyActiveMinutes\", \"AvgSedentaryMinutes\", \"AvgSleepEfficiency\")\n",
    "\n",
    "# Removing an outlier ID number 3977333714\n",
    "user_averages_for_clustering <- user_averages %>%\n",
    "  filter(Id != 3977333714) %>%\n",
    "  select(Id, all_of(clustering_vars)) %>%\n",
    "  # Remove rows with any NA in the clustering variables\n",
    "  filter(complete.cases(.))"
